import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';
import logo from '../../assets/image.png';  // Adjust the path to where your logo is stored

function Navbar() {
    return (
        <nav className="navbar">
            <div className="navbar-brand">
                <img src={logo} alt="MEwo Bank Logo" className="logo" />
            </div>
            <ul className="navbar-links">
                <li><Link to="/">Home</Link></li>
                <li><Link to="/customer">Customer Booth</Link></li>
                <li><Link to="/customer/signup">Employee Booth</Link></li>
                <li><Link to="/customer/signup">Admin Booth</Link></li>
            </ul>
        </nav>
    );
}

export default Navbar;
